import { BrowserRouter, Routes, Route } from "react-router-dom";
import './App.css';
import Home from './Components/Home'

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route index element={<Home />} />
    </Routes>
  </BrowserRouter>
  );
}

export default App;
